import React from "react";
import { Grid } from "@material-ui/core";
import Main from '../Main'
import Header from "../Header";
import Sidebar from "../SidePanel";
import Article from "../../custom/Article";
const Layout =()=>{
    return (
        <>
        <Header/>
        <Grid container>
            <Grid item xs>
                <Sidebar/>
            </Grid>
            <Grid item>
                <Article/>
            </Grid>
        </Grid>
        </>
    )
};

export default Layout;
